        a_in = clp / (1 + clp * olg)
        a_sense = clp * olg / (1 + clp * olg)
        a_disp = clp**2 * olg / (1 + clp * olg) + chp
    else:
        a_in = clp * (1 + olg) / (1 + clp * olg)
        a_sense = chp * olg / (1 + clp * olg)
        a_disp = chp / (1 + clp * olg)

    return a_in, a_sense, a_disp

