def _next_smooth_int(n):

  if n <= 2:
    return 2
  if n % 2 == 1:
    n += 1    # Even.
  n -= 2      # Cancel out +2 at the beginning of the loop.
  ndiv = 2    # Dummy value that is >1.
  while ndiv > 1:
    n += 2
    ndiv = n
    while ndiv % 2 == 0:
      ndiv /= 2
    while ndiv % 3 == 0:
      ndiv /= 3
    while ndiv % 5 == 0:
      ndiv /= 5
  return n

