def get_min_value_node(root):

    curr = root
    while curr.left is not None:
        curr = curr.left
    return curr

def jaccard(s1, s2):


    if len(s1) == 0 or len(s2) == 0:
        return 1
    return 1 - 1.0 * len(s1.intersection(s2)) / len(s1.union(s2))
